$bp-minimum: 32rem;
$bp-mobile: 37.5rem;
$bp-tablet: 76.8rem;

.audit {
    display: flex;
    flex-direction: row;

    @media only screen and (max-width: $bp-tablet) {
        flex-direction: column;
        margin: 0 auto;
    }

    &_left {
        width: 49.6rem;
        height: 11.8rem;
        margin-right: 2.3rem;
        font-size: 2.2rem;
        line-height: 4rem;

        @media only screen and (max-width: $bp-tablet) {
            width: 60rem;
            margin-top: 15rem;
            margin-left: 8rem;
            text-align: center;
        }

        @media only screen and (max-width: $bp-mobile) {
            width: 30.7rem;
            height: 16.3rem;
            margin: 0 auto;
            font-size: 2.2rem;
            text-align: left;
        }

        @media only screen and (max-width: $bp-minimum) {
            width: 28rem;
            height: 12.3rem;
            font-size: 1.8rem;
            line-height: 2.5rem;
            text-align: center;

        }
    }

    &_right {
        width: 37.5rem;
        height: 7.2rem;
        font-size: 2rem;
        font-weight: bold;

        @media only screen and (max-width: $bp-tablet) {
            text-align: center;
            width: 76.8rem;

        }

        @media only screen and (max-width: $bp-mobile) {
            margin: 0 auto;
            width: 32.3rem;
            margin-left: 2rem;
        }

        @media only screen and (max-width: $bp-minimum) {
            width: 28rem;
        }
    }
}

sources.sass\\_base.scss:
:root {
    --color-red: #EE325C;
    --color-red-hover: #ae1e3e;
    --color-white: #fff;
    --color-grey: #D6D8DD;
    --color--input-grey: #EFEFEF;
    --color-black: #000;
    --color-green: #6BBC13;
    --color-underline: rgba(238, 50, 92, 0.2);
}

// Minimal resolution 320px
$bp-minimum: 20em;
// Mobile version 375px
$bp-mobile: 23.4375em;
// Tablet resolution 768px
$bp-tablet: 48em;


*,
*::before,
*::after {
    box-sizing: inherit;
}

* {
    margin: 0;
    padding: 0;
}

html {
    /* 1rem = 10px */
    /* 16px -> 100% 10px = 62.5%*/
    font-size: 62.5%;
    box-sizing: border-box;
    font-family: 'Mulish', sans-serif;
}

body {
    font-family: 'Mulish', sans-serif;
}

.main {
    width: 144.0rem;

    @media only screen and (max-width: $bp-tablet) {
        width: 76.8rem;
    }

    @media only screen and (max-width: $bp-mobile) {
        width: 37.5rem;
    }

    @media only screen and (max-width: $bp-minimum) {
        width: 32rem;
    }
}

.container {
    width: 92rem;
    margin: 0 auto;
    margin-top: 7.5rem;
    margin-bottom: 20.5rem;

    @media only screen and (max-width: $bp-tablet) {
        margin: 0;
    }

    @media only screen and (max-width: $bp-mobile) {
        width: 37.5rem;
    }

    @media only screen and (max-width: $bp-minimum) {
        width: 32rem;
    }
}

/* Elements */

.h1 {
    font-size: 5rem;
    font-weight: 900;

    animation: pop-in 2s cubic-bezier(0, 0.5, 0, 1) forwards;

    @media only screen and (max-width: $bp-mobile) {
        font-size: 3rem;
    }

    @media only screen and (max-width: $bp-minimum) {
        font-size: 2.5rem;
    }
}

.h2_32 {
    font-size: 4.8rem;
    font-weight: 700;

    animation: pop-in 1s cubic-bezier(0, 0.9, 0.3, 1.2) forwards;

    @media only screen and (max-width: $bp-tablet) {
        font-size: 3.2rem;
    }

    @media only screen and (max-width: $bp-mobile) {
        font-size: 3.2rem;
    }

    @media only screen and (max-width: $bp-minimum) {
        font-size: 2rem;
    }
}

.h2_24 {
    font-size: 4.8rem;
    font-weight: 700;

    animation: pop-in .6s cubic-bezier(0, 0.9, 0.3, 1.2) forwards;

    @media only screen and (max-width: $bp-mobile) {
        font-size: 2.4rem;
    }

    @media only screen and (max-width: $bp-minimum) {
        font-size: 2rem;
    }
}

.h3 {
    font-size: 3rem;
    font-weight: 900;

    animation: pop-in .6s cubic-bezier(0, 0.9, 0.3, 1.2) forwards;

    @media only screen and (max-width: $bp-mobile) {
        font-size: 2.4rem;
    }

    @media only screen and (max-width: $bp-minimum) {
        font-size: 2rem;
    }
}

.h4 {
    font-size: 2.4rem;
    font-weight: 900;

    @media only screen and (max-width: $bp-minimum) {
        font-size: 2rem;
    }
}

a {
    color: var(--color-red);
}

a:hover {
    color: var(--color-red-hover);
}

.a_22 {
    text-decoration: none;
    color: var(--color-red);
    font-size: 3rem;

    @media only screen and (max-width: $bp-mobile) {
        font-size: 2.2rem;
    }

    @media only screen and (max-width: $bp-minimum) {
        font-size: 1.8rem;
    }
}

.a_22:hover {
    color: var(--color-red-hover);
}

.a_16 {
    text-decoration: none;
    color: var(--color-red);
    font-size: 1.6rem;

    @media only screen and (max-width: $bp-mobile) {
        font-size: 1.6rem;
    }
}

.a_16:hover {
    color: var(--color-red-hover);
}

.underline {
    border-bottom: 1.4rem solid var(--color-underline);
}

.bold {
    font-weight: bold;
}

.red {
    color: var(--color-red);
    font-weight: bold;
}

.red_circle {
    width: 4rem;
    height: 4rem;
    border-radius: 50%;
    background-color: var(--color-red);
    color: var(--color-white);
    position: relative;

    position: absolute;
    right: 2rem;
    top: 2.9rem;
