    &_wrapper {

        &_captcha {
            display: flex;
            height: 6.5rem;
            margin: 3rem 0 2rem;
            align-items: center;
            justify-content: space-between;


            @media only screen and (max-width: $bp-mobile) {
                width: 28rem;
            }

            @media only screen and (max-width: $bp-minimum) {
                width: 22rem;
            }


            &_img {
                height: 100%;
                width: 34.5rem;
                user-select: none;
                color: var(--color-black);
                border-radius: 0.5rem;
                position: relative;
                background-image: url(../images/captcha-bg.png);
                font-size: 3rem;
                text-align: center;
                padding-top: 1.2rem;
                font-family: 'Noto Serif', serif;

                @media only screen and (max-width: $bp-mobile) {
                    width: 20rem;
                }

                img {
                    width: 100%;
                    height: 100%;
                    object-fit: cover;
                    border-radius: 0.5rem;
                    opacity: 0.95;
                }

                span {
                    position: absolute;
                    left: 50%;
                    top: 50%;
                    width: 100%;
                    color: var(--color-white);
                    font-size: 3.5rem;
                    text-align: center;
                    letter-spacing: 1rem;
                    transform: translate(-50%, -50%);
                    text-shadow: 0 0 0.2rem #b1b1b1;
                }
