                @media only screen and (max-width: $bp-mobile) {
                    width: 6rem;
                }

                i {
                    transition: transform 0.3s ease;
                }

                i:hover {
                    transform: rotate(15deg);
                }
            }

            button {
                outline: none;
                border: none;
                color: var(--color-white);
                cursor: pointer;
                background: var(--color-red);
                border-radius: 0.5rem;
                transition: all 0.3s ease;
            }

            button:hover {
                background: var(--color-red-hover);
            }
        }

        &_input {
            width: 100%;
            height: 100%;
            outline: none;
            font-size: 2rem;
            border-radius: 0.4rem;
            display: flex;
            justify-content: space-between;
            margin-bottom: 2rem;

            position: relative;

            input {
                height: 6rem;
                width: 46.8rem;
                position: relative;
                border-radius: 0.4rem;
                border: 0.1rem solid var(--color-grey);
                cursor: pointer;

                @media only screen and (max-width: $bp-mobile) {
                    width: 28rem;
                }

                @media only screen and (max-width: $bp-minimum) {
                    width: 22rem;
                }
            }

            input:is(:focus, :valid) {
                padding-left: 1rem;
            }

            input:placeholder {
                color: var(--color-input-grey);
            }

            input:valid+.checkbutton {
                opacity: 1;
                pointer-events: auto;
            }

            .checkbutton {
                position: absolute;
                right: 0.7rem;
                top: 3rem;
                font-size: 1.7rem;
                height: 4.5rem;
                padding: 0 2rem;
                opacity: 0;
                pointer-events: none;
                transform: translateY(-50%);
                background-color: var(--color-red);
                border-radius: 0.4rem;
                border: none;
                color: var(--color-white);
                cursor: pointer;

                @media only screen and (max-width: $bp-mobile) {
                    right: 2.6rem;
                }
            }

            .checkbutton:hover {
                background-color: var(--color-red-hover);
            }
        }

        &_status {
            width: 46.8rem;
            display: none;
            font-size: 1.8rem;
            padding: 2rem;
            text-align: center;

            @media only screen and (max-width: $bp-tablet) {
                width: 46.8rem;
            }

            @media only screen and (max-width: $bp-mobile) {
                width: 28rem;
            }

            @media only screen and (max-width: $bp-minimum) {
                width: 22rem;
            }
        }
    }


}

