.testimonials {
    display: flex;
    flex-direction: row;
    gap: 7.9rem;
    margin-top: 13.2rem;
    margin-bottom: 10.4rem;

    @media only screen and (max-width: $bp-tablet) {
        flex-direction: column;
        margin-top: 8rem;
    }

    @media only screen and (max-width: $bp-mobile) {
        margin-top: 6.5rem;
    }

    @media only screen and (max-width: $bp-minimum) {
        margin-top: 5rem;
        margin-bottom: 6rem;
    }

    &_info {

        @media only screen and (max-width: $bp-tablet) {
            width: 76.8rem;
        }

        &_left {
            font-size: 1.6rem;
            border: 1px solid var(--color-grey);
            padding: 3.2rem 2.5rem 2.8rem 3.4rem;
            position: relative;
            width: 42rem;
            height: 28.4rem;
            line-height: 3.2rem;

            @media only screen and (max-width: $bp-tablet) {
                margin: 0 auto;
            }

            @media only screen and (max-width: $bp-mobile) {
                width: 32.2rem;
                margin-left: 2.8rem;
                height: 36.2rem;
                padding: 3.2rem 1.9rem 0.2rem 2.8rem;
                margin-bottom: 2.3rem;
            }

            @media only screen and (max-width: $bp-minimum) {
                width: 28rem;
                margin-left: 2rem;
                height: 40rem;
            }
        }

        &_right {
            font-size: 1.6rem;
            border: 1px solid var(--color-grey);
            padding: 3.4rem 2.8rem 2.6rem 2.8rem;
            position: relative;
            width: 42rem;
            height: 28.4rem;
            line-height: 3.2rem;


            @media only screen and (max-width: $bp-tablet) {
                margin: 0 auto;
            }

            @media only screen and (max-width: $bp-mobile) {
                width: 32.2rem;
                margin-left: 2.8rem;
                height: 36.2rem;
                padding: 3.2rem 1.9rem 0.2rem 2.8rem;
                margin-bottom: 2.3rem;
            }

            @media only screen and (max-width: $bp-minimum) {
                width: 28rem;
                margin-left: 2rem;
                height: 40rem;
            }
        }

        .person {
            display: flex;
            flex-direction: row;
            font-size: 1.6rem;
            margin-top: 3.4rem;

            @media only screen and (max-width: $bp-tablet) {
                width: 76.8rem;
                margin-left: 18rem;
            }


            @media only screen and (max-width: $bp-mobile) {
                width: 37.5rem;
                margin-left: 2.9rem;

            }

            @media only screen and (max-width: $bp-minimum) {
                width: 32rem;
            }

            &_info {
                display: flex;
                flex-direction: column;
                margin-left: 2.1rem;
                justify-content: center;

                @media only screen and (max-width: $bp-mobile) {
                    margin-left: 1.9rem;
                }

            }
        }



    }




}
